import React from 'react';
import { Container, Row, Col, Link } from 'react-bootstrap';

const UserTypeScreen = ({ history }) => {
	const redirect = location.search ? location.search.split('=')[1] : '/';
	return (
		<Container>
			<div className="row">
				<div className="col-sm-6" style={{ backgroundColor: 'whitesmoke' }}>
					<h1 style={{ textAlign: 'center' }}>Basic</h1>
					<p>
						<ul>
							<li>Add to Cart</li>
							<li>Buy Products Online</li>
						</ul>
					</p>
				</div>
				<div
					className="col-sm-6"
					style={{ backgroundColor: 'rgb(204, 204, 204)' }}
				>
					<h1 style={{ textAlign: 'center' }}> Premium </h1>
					<p>Sed ut perspiciatis...</p>
				</div>
			</div>
			<Row className="py-3">
				<Col>
					{' '}
					Already have an account?{' '}
					<Link to={redirect ? `/login?redirect=${redirect}` : '/login'}>
						{' '}
						Login Here!{' '}
					</Link>
				</Col>
			</Row>
		</Container>
	);
};

export default UserTypeScreen;
